import React from 'react'

function Chat() {

  const clearStorage = () => {
    localStorage.removeItem('chat-app-user');
  }

  return (
    <div>
      <h1>Chat</h1>
      <button onClick={() => clearStorage}>Log out</button>
    </div>
  )
}

export default Chat
